const wrapper = {
  margin: "auto",
  maxWidth: "1280px",
  minWidth: "100%",
  padding: "0 25px",
};

const Layout = (props) => (
  <div style={wrapper} className='margin-auto'>
    {props.children}
  </div>
);

export default Layout;
